import React from 'react';
import { useParams } from 'react-router-dom';

const ArticlePage = ({ match }) => {
  const { id, productName, price, productImage } = useParams();
  const articleContent = `Article Content for article with ID: ${id}`;

  return (
    <div>
      <h1>Article {id}</h1>
      <p>{productName}</p>
      <p>{productImage}</p>
      <p>{price}</p>
      <p>{articleContent}</p>
    </div>
  );
};

export default ArticlePage;
